$.fn.extend({
    animateCss: function (animateOut, animateIn) {
        var animationEnd = 'webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend';
        if (animateIn) {
            $(this).addClass('animated ' + animateOut).one(animationEnd, function () {
                $(this).removeClass('animated ' + animateOut).addClass('animated ' + animateIn).one(animationEnd, function () {
                    $(this).removeClass('animated ' + animateIn);
                })
            });
        } else {
            $(this).addClass('animated ' + animateOut).one(animationEnd, function () {
                $(this).removeClass('animated ' + animateOut);
            });
        }
    }
});
$(document).ready(function () {
    var hdr = $('#header').height(),
        fotr = $('#footer').height(),
        win = $(window).height(),
        bdy = $('body').height();
    if (bdy <= win && $(window).width() > 768) {
        var height = win - (hdr + fotr);
        $('#secction-page').css('height', height)
    }
    //-------------------------------
    var wow = new WOW({
        boxClass: 'wow', // default
        animateClass: 'animated', // default
        offset: 50, // default
        mobile: true, // default
        live: true // default
    })
    wow.init();
    var sync1 = $("#productImage");
    var sync2 = $("#productThumbnails");
    sync1.owlCarousel({
        singleItem: true,
        slideSpeed: 1000,
        navigation: false,
        pagination: false,
        afterAction: syncPosition,
        responsiveRefreshRate: 200,
        touchDrag: false
    });
    sync2.owlCarousel({
        items: 5,
        itemsDesktop: [1199, 5],
        itemsDesktopSmall: [979, 4],
        itemsTablet: [768, 3],
        itemsMobile: [479, 2],
        navigation: true,
        pagination: false,
        navigationText: false,
        responsiveRefreshRate: 100,
        afterInit: function (el) {
            el.find(".owl-item").eq(0).addClass("actived");
        }
    });
    function syncPosition(el) {
        var current = this.currentItem;
        $("#productThumbnails")
            .find(".owl-item")
            .removeClass("actived")
            .eq(current)
            .addClass("actived")
        if ($("#productThumbnails").data("owlCarousel") !== undefined) {
            center(current)
        }
    }
    $("#productThumbnails").on("click", ".owl-item", function (e) {
        e.preventDefault();
        var number = $(this).data("owlItem");
        sync1.trigger("owl.goTo", number);
    });
    function center(number) {
        var sync2visible = sync2.data("owlCarousel").owl.visibleItems;
        var num = number;
        var found = false;
        for (var i in sync2visible) {
            if (num === sync2visible[i]) {
                var found = true;
            }
        }
        if (found === false) {
            if (num > sync2visible[sync2visible.length - 1]) {
                sync2.trigger("owl.goTo", num - sync2visible.length + 2)
            } else {
                if (num - 1 === -1) {
                    num = 0;
                }
                sync2.trigger("owl.goTo", num);
            }
        } else if (num === sync2visible[sync2visible.length - 1]) {
            sync2.trigger("owl.goTo", sync2visible[1])
        } else if (num === sync2visible[0]) {
            sync2.trigger("owl.goTo", num - 1)
        }
    }
    ///////////////////////////////////////////////////////////////////////////////////
    if ($('.solutions .deception-text .content') && $('.solutions .deception-text .content').length > 0) {
        $('.solutions .deception-text .content').each(function (i, v) {
            $(v).niceScroll();
        });
    }
    if ($('.short_inof ') && $('.short_inof').length > 0) {
        $('.short_inof .scroll').niceScroll({
            cursorcolor: "#fff",
            cursorborder: "1px solid transparent",
        });
    }
    if ($('.product_info') && $('.product_info').length > 0) {
        $('.product_info').niceScroll();
    }
    if ($('.categories_list') && $('.categories_list').length > 0) {
        $('.categories_list .filters-list').niceScroll({
            cursorborder: "1px solid transparent",
        });
    }
    if ($('.category_products') && $('.category_products').length > 0) {
        var li = $('.filters-list li').first();
        var a = li.find('a').eq(0);
        var activeFilter = a.data('filter');
        li.addClass('opened');
        a.click();
        var categors = $('.category_products');
        categors.mixItUp({
            load: {
                filter: activeFilter
            },
            animation: {
                duration: 400,
                effects: 'scale(0.40) fade  stagger(50ms) translateZ(-350px)',
                easing: 'ease'
            }
        });
        var state = categors.mixItUp('getState');
        var txt = $('.filters-list a.active').text();
        $('.categorename h2').text(txt);
        $('.categorename ').attr('data-content', txt);
    }
    var animationEnd = 'webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend';
    $('.filters-list li a').click(function (e) {
        e.preventDefault();
        var txt = $(this).text();
        if ($(this).parent('li.parent-category').length) {
            $('.filters-list li.opened').removeClass('opened');
            $(this).parent('li').first().addClass('opened');
        }
        $('.categorename ').attr('data-content', txt);
        $('.categorename h2').addClass('animated fadeOut').one(animationEnd, function () {
            $('.categorename h2').text(txt);
            $(this).removeClass('animated fadeOut').addClass('animated fadeIn').one(animationEnd, function () {
                $(this).removeClass('animated fadeIn');
            });
        })
    });
    //---------------------------------------------------------------------
    if ($('#timelineSlider') && $('#timelineSlider').length > 0) {
        var timeslide = $('#timelineSlider');
        timeslide.owlCarousel({
            items: 1,
            itemsDesktop: [1000, 1],
            itemsDesktopSmall: [900, 1],
            itemsTablet: [600, 1],
            itemsMobile: false,
            slideSpeed: 500,
            mouseDrag: false,
            responsive: true,
            responsiveRefreshRate: 200,
            pagination: false,
            responsiveBaseWidth: window,
            transitionStyle: "fadeUp",
            addClassActive: true,
            afterAction: afterAction,
        });
        var owl = timeslide.data('owlCarousel');
        $('.timeline-control li a').click(function (event) {
            event.preventDefault();
            var tt = $(this).text();
            $(this).parents('.timeline_list').attr('data-content', tt);
            var x = $(this).data('id');
            console.log(x);
            owl.goTo(x)
        });
        $('.timeline_list').attr('data-content', $('.col-md-3 .timeline-control a[data-id=0]').text());
        function afterAction() {
            if (typeof owl != 'undefined') {
                $('.timeline-control a').removeClass('active');
                $('.timeline-control a[data-id=' + owl.currentItem + ']').addClass('active');
                var txt = $('.col-md-3 .timeline-control a[data-id=' + owl.currentItem + ']').text();
                $('.timeline_list').attr('data-content', txt);
            }
        }
    }
    //---------------------------------------------------------------------
    if ($('.scroll_box') && $('.scroll_box').length > 0) {
        $('.scroll_box').each(function (i, v) {
            $(v).niceScroll({
                cursorborder: "1px solid transparent",
            });
        });
    }
    //---------------------------------------------------------------------
    if ($('.box_content .scroll') && $('.box_content .scroll').length > 0) {
        $('.box_content .scroll').each(function (i, v) {
            $(v).niceScroll();
        });
    }
    //---------------------------------------------------------------------
    $('.page-menu .filters-list a').on('click', function () {
            console.log('obj');
        })
        //---------------------------------------------------------------------
    if ($(window).width() > 700) {
        $('a.zoom').each(function (i, v) {
            $(v).easyZoom();
        })
    }
    //---------------------------------------------------------------------
    if ($('#branchMap') && $('#branchMap').length > 0) {
        initBranchMap();
    }
    //---------------------------------------------------------------------
    if (($('.outstaff .emp') && $('.outstaff .emp').length > 0) && $(window).width() > 700) {
        fixheight();
    }
    //---------------------------------------------------------------------
    $(window).on('resize', function () {
        setTimeout(function () {
            if (($('.outstaff .emp') && $('.outstaff .emp').length > 0) && $(window).width() > 700) {
                fixheight();
            }
            if ($('a.zoom') && $('a.zoom').length > 0 && $(window).width() > 700) {
                $('a.zoom').each(function (i, v) {
                    $(v).easyZoom();
                })
            }
        }, 300);
    });
    //---------------------------------------------------------------------
    if ($("[data-background]") && $("[data-background]").length > 0) {
        $("[data-background]").each(function () {
            var src = $(this).attr('data-background');
            $(this).css("background-image", 'url(' + src + ')');
        });
    }
}); //-----
